import React from "react";
import { useForm } from 'react-hook-form';
// Components
import Header from './header';
import signup from './signup.svg';
// CSS
import './signup.css';
import '../App.css';








const Signup = () => {
    const {register, handleSubmit} = useForm();
    const onSubmit = (data) => {
        console.log(data)
    }
    return (
    <>
        <Header/>
        <main>
            <h1 className="titulo-form"> 
             <img src={signup} alt=" " /> Seu negócio disponível para toda a comunidade </h1>
            <div className="tagline">Preencha o formulário abaixo para conhecermos melhor você e o seu negócio</div>
            <form  onSubmit={handleSubmit(onSubmit)}>
                {/* SOBRE USUÁRIO */}
                <div className='sobre-vc'>
                    <h1>sobre você</h1>
                    <input type="text" placeholder="username" name="username" ref={register}/>
                    <input className="meio" type="text"placeholder='user@seudominio.com'  name="email" ref={register}/>
                    <input className="meio" type="password" placeholder='senha' name="password" ref={register} />
                </div>
                {/* SOBRE EMPRESA */}
                <div className='sobre-empresa'>
                    <h1>sobre sua empresa</h1>
                    <input type="text" placeholder='nome da sua empresa' name="nome-empresa" ref={register}/>
                    <textarea placeholder="sobre a sua empresa (um breve resumo sobre seu negócio)" ref={register}>

                    </textarea>
                    <input type="tel"  className="meio" placeholder='telefone de contato' ref={register}/> 
                    <input type="text" className='meio' placeholder='website' name="website" ref={register}/>
                    <input type="text" name="endereco" placeholder="endereço" ref={register}/>
                   <div className='enviar'> 
                        <button> enviar</button>
                   </div>
                </div>
            </form>



        </main>
    </>
    )
}
export default Signup;
